import React, {useState} from 'react'
import { Form, Button } from 'react-bootstrap'


const Search = () => {

    const [text, setText] = useState('')

    return (
        <div>
            <Form.Group>
                <Form.Control size="lg" type="text" placeholder="Search Characters by Name" value={text} onChange={(e) => setText(e.target.value)}/>
                <Button variant="dark">Search</Button>
            </Form.Group>
        </div>
    )
}

export default Search
